import React from 'react';
import styled from 'styled-components';
import aboutText from '../assets/about.txt'; // Import the about text

const Container = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  height: 100vh;
  background-color: #1e1e1e;
  color: white;
  padding: 20px;
`;

const Title = styled.h1`
  font-size: 3em;
  color: #00ff99;
  margin-bottom: 20px;
`;

const Description = styled.p`
  font-size: 1.5em;
  color: #ccc;
  text-align: center;
  margin-bottom: 40px;
  max-width: 800px;
`;

const Terminal = styled.div`
  background-color: #2d2d2d;
  border-radius: 5px;
  width: 80%;
  max-width: 800px;
  margin-bottom: 20px;
  box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);
`;

const TerminalHeader = styled.div`
  display: flex;
  align-items: center;
  padding: 10px;
  background-color: #333;
  border-top-left-radius: 5px;
  border-top-right-radius: 5px;
`;

const Circle = styled.div`
  width: 12px;
  height: 12px;
  border-radius: 50%;
  background-color: ${(props) => props.color};
  margin-right: 5px;
`;

const TerminalBody = styled.div`
  padding: 20px;
  font-family: 'Courier New', Courier, monospace;
  font-size: 1em;
`;

const Command = styled.div`
  display: flex;
  flex-wrap: wrap;
`;

const Prompt = styled.span`
  color: #33ff33;
`;

const CommandText = styled.span`
  color: white;
`;

const About = () => {
  return (
    <Container>
      <Title>About Me</Title>
      <Description>
        I am passionate about software engineering, particularly in leveraging AI to solve complex problems.
      </Description>
      <Terminal>
        <TerminalHeader>
          <Circle color="#ff5f56" />
          <Circle color="#ffbd2e" />
          <Circle color="#27c93f" />
        </TerminalHeader>
        <TerminalBody>
          <Command>
            <Prompt>siddhesh $ </Prompt>
            <CommandText>cat aboutsiddhesh</CommandText>
          </Command>
          <Command>
            <Prompt>aboutsiddhesh (main) $ </Prompt>
            <CommandText>{aboutText}</CommandText>
          </Command>
        </TerminalBody>
      </Terminal>
      <Terminal>
        <TerminalHeader>
          <Circle color="#ff5f56" />
          <Circle color="#ffbd2e" />
          <Circle color="#27c93f" />
        </TerminalHeader>
        <TerminalBody>
          <Command>
            <Prompt>siddhesh $ </Prompt>
            <CommandText>cd skills/tools</CommandText>
          </Command>
          <Command>
            <Prompt>skills/tools (main) $ </Prompt>
            <CommandText>ls</CommandText>
          </Command>
          <Command>
            <Prompt>Proficient With</Prompt>
          </Command>
          <Command>
            <CommandText>
              javascript react git github bootstrap html5 css3 figma
            </CommandText>
          </Command>
          <Command>
            <Prompt>Exposed To</Prompt>
          </Command>
          <Command>
            <CommandText>nodejs python adobe illustrator</CommandText>
          </Command>
        </TerminalBody>
      </Terminal>
    </Container>
  );
};

export default About;
